style.css:
@-moz-document domain("airtable.com") {
/* Apply the daisy background image to the entire Airtable interface */
    body {
        background-image: url('https://i.imgur.com/wNkrlLZ.jpg') !important;
        background-size: cover !important;
        background-position: center !important;
        background-attachment: fixed !important;
    }

    /* Customize the main content area */
    #baseContainer {
        background-color: rgba(255, 255, 255, 0.85) !important; /* Semi-transparent white background */
        backdrop-filter: blur(5px) !important; /* Adds a subtle blur effect */
    }

    /* Customize the header bar */
    .headerBar {
        background-color: #FFD700 !important; /* Sunny Yellow */
        color: #FFFFFF !important; /* Daisy White text */
        font-weight: bold !important;
        border-bottom: 2px solid #D3D3D3 !important; /* Light Gray border */
    }

    /* Customize gridlines and borders */
    .gridCell {
        border: 1px solid #D3D3D3 !important; /* Light Gray gridlines */
    }

    /* Customize sidebar */
    .sidebar {
        background-color: #98FB98 !important; /* Pastel Green */
        border-right: 2px solid #FFD700 !important; /* Sunny Yellow border */
        color: #FFFFFF !important; /* Daisy White text */
    }

    /* Customize buttons */
    button, .button, .airtableButton {
        background-color: #FFFFFF !important; /* Daisy White */
        color: #FFEB3B !important; /* Golden Yellow text */
        border-radius: 8px !important; /* Rounded corners */
        padding: 8px 12px !important;
        font-weight: bold !important;
    }

    button:hover, .button:hover, .airtableButton:hover {
        background-color: #FFD700 !important; /* Sunny Yellow on hover */
        color: #FFFFFF !important; /* White text on hover */
    }

    /* Customize hover effects for grid cells */
    .gridCell:hover {
        background-color: #FFEB3B !important; /* Golden Yellow background on hover */
        color: #FFFFFF !important; /* White text on hover */
    }
}
